window.bookSummaryJSON = "<p><b>Contains books one and two of the Prophecies series.</b></p> <p><i>Agent of Prophecy</i>, book one</p> <p><b>A 17-year-old princess's life of leisure has been shattered when an ancient prophecy forces her into the role of an assassin and guardian. It's that or death to her and everyone she loves. </b></p> <p>Arabelle is the daughter of a merchant king whose life of leisure is shattered when she's attacked by a poisonous creature that hasn't walked the land in over five centuries. Unfortunately, she finds herself an unwitting agent of an ancient prophecy that promises death to her and all she loves. </p> <p>To avoid such a fate, all she has to do is overcome the debilitating effects of the poison coursing through her veins, find the heirs to the prophecy, and help them overthrow a despot who's been ruling the land with an iron fist for nearly five centuries. As an agent of the prophecy, she has no other choice.</p> <p><i>Heirs of Prophecy</i>, book two</p> <p>Seventeen-year-old Ryan Riverton and his family are exploring some ancient caves when an earthquake turns their world upside-down.</p> <p>The Rivertons find themselves in a new land that they’re completely unprepared for. Tjeu are subjects of an ancient prophecy that predicted their arrival, and their arrival doesn’t go unnoticed. The tyrant that rules over this new land is looking for them.</p> <p>Includes a special note from the author.</p>"; 
